import React from 'react'

function Header() {
  const headerLink = [
    { text: "Blog", id: 1, url: "/" },
    { text: "About", id: 2, url: "/" },
    { text: "Links", id: 3, url: "/" },
    { text: "Contact us", id: 4, url: "/" }
  ]

  return (
    <div className="justify-between py-4 items-center border-b-[1px] flex">
      <h1 className="text-3xl pr-3">Dealiest Blog</h1>
      <div className="flex gap-5 pr-5 list-none">
        {headerLink.map((link) => (
         <li key={link.id} className="  text-lg px-10 py-4 m-0 transition items-center   ease-in-out delay-100 rounded-full hover:-translate-y-1 hover:scale-110 hover:bg-gray-400 duration-300 text-center"> 
         {link.text}
       </li>       
        ))}
      </div>
    </div>
  )
}

export default Header
